data[inc]['text'] = "The ATDnet system is an automatic lightning location network capable of sensing lightning flashes over a wide and variable geographical area. The system locates lightning by timing the arrival of unique very low frequency radio waves (know as atmospherics, or simply 'sferics') generated by individual lightning strokes at the ATDnet outstations. The differences in the arrival times of these strokes at the outstations are used to calculate the lightning's location. Data are collected every minute and BUFR encoded using the 'Universal BUFR template for lightning data' with 15 minutes of data combined into one file which is t...";
